using NUnit.Framework;
using System;
using System.Drawing;
using System.Drawing.Imaging;
using System.IO;
using TechnicalServiceSystem;

namespace UnitTests
{
    [TestFixture]
    public class ConvertersTestFixture
    {
        private static object[] ImageUrlCases =
        {
            new object[] { "image",ImageFormat.Bmp,"base64", new Bitmap(20, 20) }

        };
        [Test,TestCaseSource("ImageUrlCases")]
        public void CanConvertImageFromBase64URI(string type, ImageFormat format, string encoding, Bitmap inputImage)
        {
            inputImage.SetPixel(1,1,Color.Red);
            MemoryStream inputStream = new MemoryStream();
            inputImage.Save(inputStream, ImageFormat.Bmp);
            byte[] inputBytes = inputStream.ToArray();

            Image output;
            ImageFormat imageFormat;
            var base64String = Convert.ToBase64String(inputBytes);


            Assert.True(ImageUriParser.TryParseUri($"data:{type}/{format.ToString()};{encoding},{base64String}",out output,out imageFormat),"converter return value");
            Assert.AreEqual(format, imageFormat, "Image Extension");

            MemoryStream outputStream = new MemoryStream();
            output.Save(outputStream, imageFormat);
            byte[] outputBytes = outputStream.ToArray();

            Assert.AreEqual(inputBytes,outputBytes,"Actual image data");
        }

        private static object[] DataUrlCases =
        {
            new object[] { "image","jpeg","base64",""},
            new object[] { "image","png","base64", "" }
        };
        [Test, TestCaseSource("DataUrlCases")]
        public void CanParseDataUri(string type, string extension, string encoding, string data)
        {
            string URI = $"data:{type}/{extension};{encoding},{data}";
            Image output;
            ImageFormat imageFormat;

            Assert.True(ImageUriParser.TryParseUri(URI, out output, out imageFormat), "converter return value");

            Assert.NotNull(output);
            Assert.AreEqual(extension.ToLower(),imageFormat?.ToString().ToLower());
        }

        private static object[] InvalidDataUrlCases =
        {
            new object[] { false, "image","jpeg","base64","INVALID DATA LAWL"},
            new object[] { true, "image","jpeg","base64",null},
            new object[] { true, "image","dsgfghsf","base64", "è§!è§'ç(§(§ç()"},
            new object[] { true, "image", "jpeg","base32", "è§!è§'ç(§(§ç()"},
            new object[] { true, "video", "jpeg","base64","INVALID DATA LAWL"},
        };
        [Test, TestCaseSource("InvalidDataUrlCases")]
        public void DoesNotParseInvalidDataUri(bool shouldThrow,string type, string extension, string encoding, string data)
        {
            string URI = $"data:{type}/{extension};{encoding},{data}";
            Image output = null;
            ImageFormat imageFormat = null;

            if (shouldThrow)
                Assert.Throws<ArgumentException>(() => ImageUriParser.TryParseUri(URI, out output, out imageFormat),"converter should throw exception");
            else
                Assert.False(ImageUriParser.TryParseUri(URI, out output, out imageFormat), "converter return value");

            Assert.Null(output);
            Assert.AreEqual(null, imageFormat);
        }
    }
}
